import React, { Component } from 'react';

class item_list extends Component {
    render() {
      return (
          <div>
              <div>this.props.name</div>
              <div>this.props.cost</div>
              <button>O</button>
              <button>X</button>
          </div>
      )
    }
  }

export default item_list;
